    align-items: flex-end;
    justify-content: flex-start;
    gap: 0.7rem;
    padding: 0 10px;

    & a:hover {
        color: $secondary-clr;
        transition: all 0.5s ease-in-out;
        transform: scale(1.2);
    }
    @media only screen and (max-width: 470px), screen and (max-height: 600px) {
        height: 20vh;
        align-items: center;
        justify-content: center;
        padding-bottom: 12px;
    }
