.menu-btn {
    position: absolute;
    z-index: 1;
    right: 1rem;
    top: 1rem;
    height: 20px;
    width: 28px;
    cursor: pointer;
    @include transition-ease;

    &__burger {
        position: absolute;
        right: 0px;
        top: 0.5rem;
        width: 28px;
        height: 3px;
        background: set-text-color($primary-clr);
        @include transition-ease;

        &::before {
            content: "";
            position: absolute;
            top: -8px;
            width: 28px;
            height: 3px;
            background: set-text-color($primary-clr);
            @include transition-ease;
        }

        &::after {
            content: "";
            position: absolute;
            top: 8px;
            width: 20px;
            height: 3px;
            background: set-text-color($primary-clr);
            @include transition-ease;
        }

        &.open {
            transform: rotate(720deg);
            background: transparent;

            &::before {
                transform: rotate(45deg) translate(5px, 8px);
            }

            &::after {
                width: 28px;
                transform: rotate(-45deg) translate(3px, -7px);
            }
        }
    }
}

.nav {
    position: fixed;
    top: 0px;
    left: 0px;
    width: 100vw;
    opacity: 0.97;
    visibility: hidden;

    &.open {
        visibility: visible;
    }

    .menu-nav {
        display: flex;
        flex-flow: column wrap;
        align-items: center;
        justify-content: center;
        height: 100vh;
        overflow: hidden;

        background: $primary-clr;
        list-style-type: none;
        padding-right: 1rem;
        transform: translateY(-100%);
        @include transition-ease;

        &.open {
            transform: translateY(0);
        }

        &__item {
            transform: translateX(100vw);
            @include transition-ease;

            &.open {
                transform: translateX(0);
            }

            &.active > a {
                color: $secondary-clr;
            }
        }
        &__link {
            display: inline-block;
            font-size: 2rem;
            text-transform: uppercase;
            padding: 1.1rem 0.3rem;
            margin: 10px;
            font-weight: 400;
            border-radius: 15px;
            @include transition-ease;

            &:hover {
                color: $secondary-clr;
                font-weight:700;
                background-color: rgba(252, 245, 245, 0.528);
            }
        }
    }
}

@for $i from 1 through 4 {
    .menu-nav__item:nth-child(#{$i}) {
        transition-delay: ($i * 0.1s) + 0.15s;
    }
}

