.projects {
    padding-bottom: 2rem;

    &__bio-image {
        height: 30vh;
        width: 100%;
        background: linear-gradient(to right, rgba($primary-clr, 0.9), rgba($primary-clr, 0.3)),
            url("../img/witcher-wolf.jpg") center;
        background-size: cover;

        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: flex-end;

        .text-secondary {
            font-size: 2rem;
            margin-bottom: 2rem;
        }
    }

    &__items {
        width: 60vw;
        margin: 2rem auto 0 auto;
        display: grid;
        grid-template-columns: 1fr;
        gap: 2rem;
    }

    &__item {
        position: relative;
        border-bottom: 5px solid $secondary-clr;
        overflow: hidden;
        cursor: pointer;
        border-radius: 12px;
        padding: 10px;

        img {
            width: 100%;
        }

        &::after {
            content: "";
            position: absolute;
            top: 100%;
            left: 0;
            height: 100%;
            width: 100%;
            background: $secondary-clr;
            opacity: 0;
            @include transition-ease;
        }

        &:hover {
            &::after {
                top: 0;
                opacity: 0.9;
            }
            .projects__btn{
                opacity: 1;
            }
        }
    }

    &__btns {
        position: absolute;
        top: 0;
        height: 100%;
        width: 100%;
        z-index: 1;
        display: grid;
        grid-template-columns: repeat (2, 1fr);
        align-items: center;
        text-align: center;
    }

    &__btn {
        opacity: 0;
        color: set-text-color($secondary-clr);
        @include transition-ease;

        &:hover {
            color: set-text-color(set-text-color($secondary-clr));
        }
    }
    footer {
        transform: rotate(90deg) translate(-3rem, -5rem);
    }
}

